$(function () {
	//=>创建SWIPER结构
	let $mainBox = $('.mainBox'),
		$HTML = $mainBox.html(),
		$slides = null;
	$HTML = `<div class="swiper-container">
		<div class="swiper-wrapper">
			${$HTML}
		</div>
	</div><a href="javascript:;" class="PREBTN"></a>`;
	$mainBox.html($HTML);
	$slides = $mainBox.find("div[class^='page']");
	$slides.each((index, item) => {
		$(item).addClass('swiper-slide');
	});

	//=>处理滑屏的动画效果
	let GET_N = item => {
		let p = item.parentNode;
		while (p.className.indexOf('swiper-slide') < 0) {
			p = p.parentNode;
		}
		let reg = /page(\d+)/g
		return parseInt(reg.exec(p.className)[1]) || 0;
	};
	let $AN = [];
	$mainBox.find('.swiper-slide').find('*').each((index, item) => {
		let v = $(item).attr('AN');
		if (v) {
			let n = GET_N(item),
				t = item.tagName.toLowerCase(),
				m = `page${n}_${t}_${index}`;
			$(item).addClass(m);
			$AN.push({
				tag: t,
				an: v,
				n: n,
				m: m
			});
		}
	});
	let STY = ``;
	$AN.forEach(item => {
		let {
			tag,
			an,
			n,
			m
		} = item;
		STY += `.page${n} .${m}{
			opacity:0;
		}#page${n} .${m}{
			animation:${an};
		}`;
	});
	$('head').append(`<style>${STY}</style>`);

	//=>初始化SWIPER
	let move = swiper => {
		let activeIn = swiper.activeIndex,
			slideAry = [].slice.call(swiper.slides);

		//=>设置ID
		slideAry.forEach((item, index) => {
			if (activeIn === index) {
				item.id = `page${index + 1}`;
				return;
			}
			item.id = null;
		});

		//=>最后一页不显示上划按钮
		if (activeIn >= (slideAry.length - 1)) {
			$('.PREBTN').css('display', 'none');
		} else {
			$('.PREBTN').css('display', 'block');
		}
	};
	new Swiper('.swiper-container', {
		direction: 'vertical',
		onInit: move,
		onTransitionEnd: move
	});

	//=>音乐的处理
	let $music = $mainBox.attr('music');
	if ($music) {
		$mainBox.append(`<audio src="${$music}" autoplay loop style="display:none;"></audio><a href="javascript:;" class="MUSICBTN MOVE"></a>`);
		let $MUSICBTN = $('.MUSICBTN'),
			$AUDIO = $('audio'),
			AUDIO = $AUDIO[0];
		$MUSICBTN.tap(ev => {
			if (AUDIO.paused) {
				AUDIO.play();
				$MUSICBTN.addClass('MOVE');
				return;
			}
			AUDIO.pause();
			$MUSICBTN.removeClass('MOVE');
		});
	}
});